Always run long enough for meaningful block production : use std::time::Duration; use testing_framework_core::scenario::ScenarioBuilder;
use testing_framework_workflows::ScenarioBuilderExt; pub fn minimum_run_windows() { // Bad: too short (~2 blocks with default 2s slots, 0.9 coeff) let _too_short = ScenarioBuilder::with_node_counts(1, 0) .with_run_duration(Duration::from_secs(5)) .expect_consensus_liveness() .build(); // Good: enough blocks for assertions (~27 blocks with default 2s slots, 0.9 // coeff) let _good = ScenarioBuilder::with_node_counts(1, 0) .with_run_duration(Duration::from_secs(60)) .expect_consensus_liveness() .build();
} Note: Block counts assume default consensus parameters: Slot duration: 2 seconds (configurable via CONSENSUS_SLOT_TIME) Active slot coefficient: 0.9 (90% block probability per slot, configurable via CONSENSUS_ACTIVE_SLOT_COEFF) Formula: blocks ≈ (duration / slot_duration) × active_slot_coeff If upstream changes these parameters, adjust your duration expectations accordingly. The framework enforces minimum durations (at least 2× slot duration), but be explicit. Very short runs risk false confidence—one lucky block doesn't prove liveness.

